-- Table: Patients
CREATE TABLE Patients (
    PatientID SERIAL PRIMARY KEY,
    FirstName VARCHAR(50),
    LastName VARCHAR(50),
    DateOfBirth DATE,
    Gender VARCHAR(10),
    PhoneNumber VARCHAR(15),
    Email VARCHAR(100),
    Address TEXT,
    BloodType VARCHAR(3),
    EmergencyContact VARCHAR(15)
);

  

